  false,\n\t\"url\": null,\n\t\"notes\": \"The Climate Prediction Center (CPC) Madden
  Julian Oscillation index (MJO) is a dataset that allows evaluation of the strength
  and phase of the MJO during the dataset period. The index is based on pentad 200-hPa
  velocity potential data equator ward of 30?N during El Ni?o/Southern Oscillation
  (ENSO) neutral and weak ENSO winters (November-April) in 1979-2000. An extended
  Empirical Orthogonal Function (EEOF) analysis is used to identify ten time-lagged
  patterns. Ten MJO indices are determined by projecting the pentad 200-hPa velocity
  potential anomalies onto the ten time-lagged patterns of the first EEOF of pentad
  200-hPa velocity potential anomalies. Anomalies are based on the 1979-1995 period,
  and each index is normalized by its standard deviation during ENSO-neutral and weak
  ENSO winters (November-April) in 1979-2000.\",\n\t\"license_title\": null,\n\t\"extras\":
